import React from 'react';

function Header({handleLoginClick}){

   const handleClick = () => {
      handleLoginClick()
   }
   return <nav>
      <ul>
         <li><h1>KeeperApp</h1></li>
         <li><button onClick = {handleClick} className = "loginicon">Login</button></li>
         <li><button onClick = {handleClick} className = "loginicon">SignUp</button></li>
      </ul>
      </nav>
   
}

export default Header;
